sys_variable_value.value:
(function execute(inputs, outputs) {
    var agencies = JSON.parse(inputs.agencies)

    var updatedAgencies = agencies.map(function(agency) {
      var words = agency.title.trim().toLowerCase().split(" ")

      // captialize beginning of each word and
      // handle special cases seen in Agency titles
      words = words.map(function(word) {
        if (!word) return word // assumes word is an extra space and ignores
        if (listContains(word, ["&"])) return word // simply return defined special characters
        if (word === "u.s.") return "U.S." // special case
        if (word.match(/\([A-Za-z]+\)/)) return "" // remove acronyms if in title (AF)

        return word[0].toUpperCase() + word.slice(1)
      })

      var newLabel = words.join(" ").trim()

      return = {
        label: newLabel + " (" + agency.acronym + ")",
        title: agency.title,
        acronym: agency.acronym,
        css_id: agency.agencyId,
      }

   })

    outputs.updated_agencies = JSON.stringify(updatedAgencies)

})(inputs, outputs);

