sys_variable_value.value:
(function execute(inputs, outputs) {

  var AGENCY_TABLE = "x_g_dis_atat_agency"
  var errUtil = new ErrorHandler()
  var agenciesAdded = 0 
  var duplicateAgencies = 0

  try {
    var agencies = JSON.parse(inputs.updatedAgencies)
    agencies.forEach(function(agency) {
      var agencyQuery = new global.GlideQuery(AGENCY_TABLE)
      var foundRecords = agencyQuery 
        .where("title", agency.title)
        .count()

      // log error for duplicate agency
      if (foundRecords > 1) {
        var duplicateRecords = agencyQuery
          .where("title", agency.title)
          .select("title", "css_id")
          .toArray(5)
        var errorMessage = "More than one CSS Agency record found. Remove duplicates."
        errorMessage += "Duplicate records: " + JSON.stringify(duplicateRecords)

        gs.error(errUtil.createError(errorMessage, "DuplicateRecords"))
        duplicateAgencies++
      }

      // insert new agency record
      if (foundRecords === 0) {
        var insertedRec = agencyQuery.insert({
          label: agency.label,
          title: agency.title,
          acronym: agency.acronym,
          css_id: agency.css_id,
        })
        .get()

        gs.debug(JSON.stringify(insertedRec))
        agenciesAdded++
      }
    })

  } catch (error) {
    errUtil.errorLogger(error)
  }

  outputs.added_agencies_count = agenciesAdded
  outputs.duplicate_agencies_count = duplicateAgencies 

})(inputs, outputs);

